import React from "react";
import { Drawer, Card, Divider, Input } from "antd";
const SearchOrder = ({ visible, onSearch, onClose, search }) => {
  return (
    <Drawer closable={false} visible={visible} onClose={onClose} width={400}>
      <Input.Search
        placeholder="input search text"
        onSearch={value => onSearch(value)}
        className="w-100"
      />
      <Divider />
      <Card title="123"></Card>
    </Drawer>
  );
};

export default SearchOrder;
